import React from 'react';
import { graphql } from 'react-relay';
import AddBook from './addbook';
import Book from './Book';

type Props = {
  books:Map
}
class BookList extends React.Component<Props>
{

  render()
  {
    this.props.books.forEach(book=>console.log(book));
    console.log(this.props.books.size);
    return(
    <div>
    {this.props.books.size>0?this.props.books.forEach(book=>(<Book book={book}/>)):''}

    <AddBook onAddBook={this.props.onAddBook}/>
    </div>
  );
}
}

export default BookList;
